description:
A conexão com o divino que está em nós permite um mergulho profundo nos ritmos cósmicos, que vibram em uníssono com todas as camadas do universo e, necessariamente, dos seres que habitamos.
 // 
The connection with the divine within us allows for a deep dive into the cosmic rhythms, which vibrate in unison throughout all layers of the universe and, necessarily, of the beings we inhabit.
